"text": "<div>\n<i class=\"NoteType\">\nAssociation Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMargaret, Known as Mrs Flood was employed to help Laurie with family tasks around the home, (Mill House, Bollin Grove, Prestbury) which for instance would include making breakfast for Laurie's father (Henry) while Laurie took the kids to school, she would also tidy up the kitchen, do occasional ironing and baby sitting.\n</p>\n</div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMrs Flood not only helped Laurie with some family tasks she in-fact was just like having a caring Mum/Grandma around the home, loved by all.\n</p>\n</div>\n<i class=\"NoteType\">\nAssociation Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nNellie was employed to help Laurie with house work at (Mill House, Bollin Grove, Prestbury). She was very helpful with Laurie's father and had a very friendly nature about her and good with the kids.\n</p>\n</div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nNellie, was not just a domestic worker for Laurie. She also came out on the occasional days outing with Laurie, her father and kids, notably Southport and Dove Dale.\n</p>\n</div>\n</div>",
